export const Banner = () => {
  return (
    <div className={'banner-bg banner'}>
      <div className={"col-md-12 d-flex "}
           style={{
             backgroundImage: `url(${require('../../../assets/—Pngtree.png')})`,
             backgroundPosition: 'center',
             backgroundSize: 'cover',
             backgroundRepeat: 'no-repeat',
             minHeight: '543px',
             borderRadius: '30px'
           }}
      >
        <div className={'col-md-6 d-flex flex-column justify-content-center p-5'}>
          <div className={'bigTitle white-color'}>
            Pixel 4 modern edition
          </div>
          <div className={"paragraph white-color"}>
            Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s
          </div>
          <div className={'raffle-button mt-5 small-paragraph d-flex'}>
            <span> Raffle starts in </span> <img alt={'timer icon'} src={require('../../../assets/icons/timer.svg')}/>
          </div>
        </div>
        <div className={'col-md-6'}>
          <img src={"https://lh3.googleusercontent.com/proxy/GXvIXtHh0YkAZPA7WYVaDngtqdf_nC3-cPGfn_ycczmCuD-2wo87gq6odCeZV1_OKh5EUBIJgjwXyPO1uK8N4ggb9IZjXUAeyS2NrIzgRsv_YNaajSfA7KiIL9iSuS22VFI3sbeEOTA1kS-UoGAsOUCt"} alt={"post-images"}/>
        </div>
      </div>
    </div>
  )
};
